import React, { useState, useEffect } from 'react';
import Sidebar from './Sidebar';
import './dgf.css';
import axios from 'axios';

const API_BASE_URL = 'http://localhost:4069/society/homepage'; // Adjust the base URL as needed

const DirectoryPage = () => {
  const [admins, setAdmins] = useState([]);
  const [residents, setResidents] = useState([]);
  const [staffs, setStaffs] = useState([]);
  const [viewType, setViewType] = useState(''); // To handle the view type
  
  useEffect(() => {
    // Fetch all user data on component mount
    const fetchData = async () => {
      try {
        const adminResponse = await axios.get(`${API_BASE_URL}/admin`);
        const residentStaffResponse = await axios.get(`${API_BASE_URL}/staff`);
        
        setAdmins(adminResponse.data);
        setResidents(residentStaffResponse.data.residents);
        setStaffs(residentStaffResponse.data.staffs);
      } catch (error) {
        console.error('Failed to fetch data:', error);
      }
    };

    fetchData();
  }, []);

  const renderTable = () => {
    if (viewType === 'admin') {
      return (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Contact Number</th>
            </tr>
          </thead>
          <tbody>
            {admins.map((admin) => (
              <tr key={admin._id}>
                <td>{admin.name}</td>
                <td>{admin.email}</td>
                <td>{admin.contact}</td>
              </tr>
            ))}
          </tbody>
        </table>
      );
    } else if (viewType === 'resident') {
      return (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Contact Number</th>
              <th>Flat Number</th>
            </tr>
          </thead>
          <tbody>
            {residents.map((resident) => (
              <tr key={resident._id}>
                <td>{resident.name}</td>
                <td>{resident.email}</td>
                <td>{resident.contact}</td>
                <td>{resident.flat}</td>
              </tr>
            ))}
          </tbody>
        </table>
      );
    } else if (viewType === 'staff') {
      return (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Contact Number</th>
              <th>Role</th>
            </tr>
          </thead>
          <tbody>
            {staffs.map((staff) => (
              <tr key={staff._id}>
                <td>{staff.name}</td>
                <td>{staff.email}</td>
                <td>{staff.contact}</td>
                <td>{staff.role}</td>
              </tr>
            ))}
          </tbody>
        </table>
      );
    }
    return null;
  };

  return (
    <div className="page-container">
      <Sidebar />
      <div className="main-content">
        <h2>Directory</h2>
        <button onClick={() => setViewType('admin')}>Admin</button>
        <button onClick={() => setViewType('resident')}>Resident</button>
        <button onClick={() => setViewType('staff')}>Staff</button>
        {renderTable()}
      </div>
    </div>
  );
};

export default DirectoryPage;
